                            },
                            "nextPage": {}
                        }
                    },
                    "meta": {
                        "type": "object",
                        "properties": {
                            "httpStatus": {
                                "type": "string"
                            },
                            "requestId": {
                                "type": "string"
                            }
                        }
                    }
                }
